// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0; //solhint-disable compiler-fixed


import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-periphery/contracts/interfaces/IQuoterV2.sol";


contract SwapOracle {

    // ISwapRouter public immutable swapRouter;
    IQuoterV2 public immutable quoterV2;
    address private constant DAI_ADDRESS = 0x6B175474E89094C44Da98b954EedeAC495271d0F;

    constructor(IQuoterV2 _quoterV2) { //solhint-disable func-visibility
        quoterV2 = _quoterV2;
    }

    function getQuotedPrice(uint amount, address token0, uint24 fee) external
        returns(uint quote) {
            IQuoterV2.QuoteExactInputSingleParams memory quoteParams =
                IQuoterV2.QuoteExactInputSingleParams({
                    tokenIn: token0,
                    tokenOut: DAI_ADDRESS,
                    amountIn: amount,
                    fee: fee,
                    sqrtPriceLimitX96: 0
                });

            (quote, , , ) = quoterV2.quoteExactInputSingle(quoteParams);
            return quote;
        }


}
